import React, { Component } from 'react';
import NavigationCategory from './NavigationCategory';

class NavigationCategoryList extends Component {
  renderCategories() {
    const { selectCategory, categories } = this.props;

    return categories.map((category) => {
      const { id, title } = category;
      return (
        <NavigationCategory
          // Every time you have a list you need a key prop
          key={id}
          title={title}
          id={id}
          selectCategory={selectCategory}
        />
      );
    });
  }
  render() {
    return (
      <div>
        <div className="navigationCategory">{this.renderCategories()}</div>
      </div>
    );
  }
}
export default NavigationCategoryList;
